window.bookSummaryJSON = "<p><b>Six years ago, I awoke in a cage with no knowledge of who I was or where I’d come from.</b></p> <p>Six years ago, I was spared the flesh markets and instead thrown in with a group of savages, where I learned it was fight or die.</p> <p>Now, eight Orders of Assassins are converging on the only home I’ve ever known. All in hopes of purchasing new blade slaves for their ranks.</p> <p>I’m for sale, yet all I want is a life far from death and ownership. Then I meet them, the Order of Scorpions.</p> <p>Their allure is a threat to the freedom I crave, but I won’t fall victim to their sting, no matter how tempting it might be.</p> <p>They want to own me, to claim me, but the Scorpions have no idea what they’ve bargained for.</p> <p>They’re about to learn what venom flows in my veins. I don’t just bite…I destroy.</p> <p><i>Order of Scorpions</i> is a why-choose dark romance. It contains graphic violence, strong language, explicit romance, and other content that could be triggering. Listener discretion is advised.</p>"; 
